  false,\n\t\"url\": null,\n\t\"notes\": \"The Tu1e Valley drainage basin is an area
  of about 940 square miles (2,430 square kilometers) in Juab and Millard Counties
  in westcentral Utah. Precipitation in the basin averages about 8 inches (203 millimeters)
  annually. There is no surface outflow and all streams are ephemeral. Annual runoff
  averages about 0.09 inch (2.3 millimeters). Because there is no sustained runoff,
  and flow is local and infrequent, reservoirs do not provide dependable water supplies.\",\n\t\"license_title\":
